// Import necessary modules and components
import React from 'react';
import ReactDOM from 'react-dom';
import Header from './Components/Header';
import Footer from './Components/Footer';
import Home from './Pages/Home';
import ContactUs from './Pages/ContactUs';
import News from './Pages/News';
import AdmissionStatus from './Pages/AdmissionStatus';
import CertificateCalculator from './Pages/CertificateCalculator';
import NationalUniversitesGuide from './Pages/Universites/NationalUniversites/GuideMain';

// Render the components to the DOM
ReactDOM.render(
  <React.StrictMode>
    <Header />
    {/* Define routes for different pages */}
    <Switch>
      <Route exact path="/" component={Home} />
      <Route path="/contact" component={ContactUs} />
      <Route path="/news" component={News} />
      <Route path="/admission-status" component={AdmissionStatus} />
      <Route path="/certificate-calculator" component={CertificateCalculator} />
      <Route path="/universities/guide" component={NationalUniversitesGuide} />
    </Switch>
    <Footer />
  </React.StrictMode>,
  document.getElementById('root')
);
